import React from 'react';

const DashboardPage = () => {
  return (
    <div>
      <h2 className='mt-8 text-center font-extrabold text-4xl text-neutral-900 mb-2 font-inter'>Dashboard Page</h2>
      <p className="text-center text-lg text-neutral-500">Welcome to the dashboard!</p>
    </div>
  );
};

export default DashboardPage;
